import React from 'react';
import EachConversation from "./EachConversation";

class ConversationsBody extends React.Component{
    constructor(props){
        super(props);
    }

    render() {
        return (
            <div className="box-body">
                <div className="conversation-items">
                    {this.props.conversations.map(((conversation, key) => {
                        return <EachConversation key={key} conversation={conversation}/>
                    }))}
                </div>
            </div>
        );
    }
}

export default ConversationsBody;
